import SpecialText from '../components/documentationComponents/SpecialText';

const data = {
    meshparticles: {
        title: "Mesh Particles",
        description: `
            Spawn 3d particles inside you world.
        `,
        elements: [
            <p>Go to https://www.roblox.com/library/11453345861/ParticlePlugin And click on the install button to install the plugin.</p>,
            <SpecialText title='works' type="path" content="string"/>
        ]
    },
}

export default data;
